private void usefemale(Atom a,bool enable){
JSONStorable abool = a.GetStorableByID("geometry");
JSONStorableBool use = abool.GetBoolJSONParam("useFemaleMorphsOnMale");	
use.val=enable;	
}

private void usemale(Atom a,bool enable){
