public static int intparse(string s)
{
	if(s==""){return 0;}
	
		int y = 0;int total=0;
		if(s.Substring(0,1)=="-"){s=s.Substring(1);
		
	        for (int i = 0; i < s.Length; i++)
               y = y * 10 + (s[i] - '0');
        total -= y;	
		
		}else{
		
        for (int i = 0; i < s.Length; i++)
               y = y * 10 + (s[i] - '0');
        total += y;
}
		
		return total;
}


